INSERT INTO `brands` (`id`, `name`, `contact_person`, `about`, `telephone`, `mobile`, `logo`, `acma_id`, `created_at`, `updated_at`, `deleted_at`, `email`, `password`) VALUES
	('12cb89d0-3933-11e9-9621-ffa6d07f4b07', 'Mowelfund', 'Boots Anson-Roa', 'Mowelfund, or the Movie Workers Welfare Foundation, is an organization in the Philippines that provides for the welfare of workers in the film industry.', '233-1223', '09212901231', '1551122713mowelfund_logo_for_web.png', 'bdc38430-391a-11e9-8b52-a954e7a477cd', '2019-02-26 03:25:13', '2019-02-26 03:25:13', NULL, 'mowelfund@mowelfund.com', '$2y$10$n0kLK6p/3r5OQbWCS6d/h.YvxnwOTCjj0Wb2oNVtJM/pqg/k/ji1u'),
	('232d2fa0-392c-11e9-933d-0f78946155b2', 'Lexdale', 'Seijuro Akashi', 'Lexdale is the number one engineering company in Metro Manila', '008-0000', '09279653712', '15511630771.png', 'bdc38430-391a-11e9-8b52-a954e7a477cd', '2019-02-26 02:35:34', '2019-02-26 14:37:57', NULL, 'lexdale@lexdale.com', ''),
	('4e317b30-3987-11e9-b508-53c6db3ceb85', 'Fil-global', 'Bertch Mison', 'Fil-global is a world-class company that started in London and then branched out in Philippines offering immigration and university placement to other part of the world.', '256-9829', '09201345671', '155116249112809623_177643299284374_6510538007414319513_n-1.jpg', 'd4576cb0-3919-11e9-91ac-811d16cb12c5', '2019-02-26 13:28:10', '2019-02-26 14:35:57', NULL, 'filglobal@filglobal.com', ''),
	('74863020-3933-11e9-85bf-1b8e2268f64f', 'Spotify', 'Ren Bercasio', 'Spotify (/ˈspɒtɪfaɪ/) is an audio streaming platform launched by Spotify AB on 7 October 2008. It provides DRM-protected music and podcasts from record labels and media companies. As a freemium service, basic features are free with advertisements or automatic music videos, while additional features, such as improved streaming quality, are offered via paid subscriptions.', '347-5323', '09083333333', '155112287752800512_2412633248769492_887206687050563584_n.png', '1ef576b0-3919-11e9-932b-c3d5c6a7617c', '2019-02-26 03:27:57', '2019-02-26 03:27:57', NULL, 'spotify@spotify.com', '$2y$10$.jpin0PuzkjkAtCndC7itO.NghI3AYvED33HxGqkxL/jeNSXPHsUS'),
	('a095f260-391a-11e9-befa-df3123d33b10', 'Luljetta', 'Mary Joy', 'Luljetta is a number one spa in the Philippines.', '255-5643', '09201292705', '1551123092luljetta.jpg', 'd4576cb0-3919-11e9-91ac-811d16cb12c5', '2019-02-26 00:30:13', '2019-02-26 03:31:32', NULL, 'luljetta@captivate.com', ''),
	('ab41a720-3919-11e9-afdc-890822f1037a', 'Jollibee', 'Danny Virtucio', 'ollibee is a Filipino multinational chain of fast food restaurants owned by Jollibee Foods Corporation (JFC). As of April 2018, JFC had a total of about 1,200 Jollibee outlets worldwide.[1] with presence in Southeast Asia, the Middle East, Hong Kong, North America, Italy, and the UK in London.', '749-3452', '09093468264', '1551111801jollibee.png', '1ef576b0-3919-11e9-932b-c3d5c6a7617c', '2019-02-26 00:23:22', '2019-02-26 00:23:22', NULL, 'jollibee@captivate.com', '$2y$10$w8/jGquaUO8mTL0ftLx9ieLxLyqbWsLBfXEmAArKYbdl/NlMeiAry'),
	('c5a3e2a0-3933-11e9-be70-3528415245f4', 'Petron Corporation', 'Veronica Reyes', 'Petron Corporation (PSE: PCOR) is the largest oil refining and marketing company in the Philippines, supplying more than a third of the country’s oil requirements. It operates a refinery in Limay, Bataan, with a rated capacity of 180,000 barrels per day (29,000 m3/d). From the refinery, Petron moves their products mainly by sea to 32 depots and terminals in the country. They operate a lube oil blending plant at their Pandacan Terminal, where it manufactures lubes and greases.', '145-2414', '09125489213', '155112301353055619_2257859081138571_3744555511756881920_n.jpg', '1ef576b0-3919-11e9-932b-c3d5c6a7617c', '2019-02-26 03:30:13', '2019-02-26 03:30:13', NULL, 'petron@petron.com', '$2y$10$iVYtzkLTfu7R0vUj0H348uT8WafIK/xcC2iErjypx3G.j9v2pNcp2'),
	('e9999600-3a24-11e9-976c-e19fce322515', '7 Eleven', 'Mr. Alexies Iglesias', 'This is 7 eleven', '123-7892', '09422743927', '15512265821200px-7-eleven_logo.svg.png', 'd4576cb0-3919-11e9-91ac-811d16cb12c5', '2019-02-27 08:16:22', '2019-02-27 08:16:22', NULL, 'admin@seveneleven.com', '$2y$10$SjKiNXyYgROM/03Y6s1gnu.o3UWaOufXpbFihs0Lqa3kGmXTWS4b6');
